import React from 'react'
import '../styles/skills.css';
import SkillsAvatar from '../assets/img/avatar/ar-skills-avatar.png';
import ProgressBar from "./ProgressBar";


const skillsProgress = [
    {
        span: 'ReactJS',
        bgcolor: "#FEC3C3",
        completed: 30
    },
    {
        bgcolor: "#FEC3C3",
        completed: 30
    },
    {
        bgcolor: "#FEC3C3",
        completed: 40
    },
];

function Skills() {
    return (
        <div className="container">
            <div className="skills-content">
                <img src={SkillsAvatar} alt="Andrea Recuyo Skills Avatar"></img>
                <div className="skills-header">
                    <h1>Skills</h1>
                    <div className="skills-progress">
                        {skillsProgress.map((item, idx) => (
                            <ProgressBar key={idx} span={item.span} bgcolor={item.bgcolor} completed={item.completed} />
                        ))}
                    </div>
                </div>

            </div>
        </div>
    )
}

export default Skills;
